import React from 'react'
import { Input as InputR } from 'reactstrap'

const Input = ({ name, id, placeholder, labelName, type, ...props }) => {
  return (
    <div>
      if(labelName)
      {
        <label key={id} for={id}>
          {labelName}
        </label>
      }
      <InputR
        name={name}
        key={id}
        id={id}
        placehoder={placeholder}
        type={type}
      />
    </div>
  )
}

export default Input
